import axios from 'axios'


const FirePokemon = () => {

  const [data, setData] = useState(null)

  useEffect(() => {
    const getData = async () => {
      const response = await axios.get("https://pokeapi.glitch.me/v1/pokemon/1")
      setData(response)
    }
    getData()
  }, [])

